import logo from './logo.svg';
import './App.css';
import Greet from './components/Greet'
import Table from './components/Table'


function App() {
  var heading = ['Name', 'City', 'Course'];
  var body =
      [['Kapil', 'Jaipur', 'MCA'],
      ['Aakash', 'Hisar', 'Btech'],
      ['Mani', 'Ranchi', 'MSc'],
      ['Yash', 'Udaipur', 'Mtech']
      ];
  return (
    <div className="App">
      <Greet />
      <Table heading={heading} body={body} />
    </div>
  );
}

export default App;
